    chart.draw(data, options);
  }

function supports_html5_storage() {
  try {
    return 'localStorage' in window && window['localStorage'] !== null;
  } catch (e) {
    return false;
  }
}

function getCookie(c_name) {
  if (supports_html5_storage()) {
    try {
        return localStorage.getItem(c_name);
    } catch (e) {
        return false;
    }    
  } else  {
    if (document.cookie.length>0) {
      c_start=document.cookie.indexOf(c_name + "=");
      if (c_start!=-1) {
          c_start=c_start + c_name.length+1;
          c_end=document.cookie.indexOf(";",c_start);
          if (c_end==-1) c_end=document.cookie.length;
          return unescape(document.cookie.substring(c_start,c_end));
      }
    }
    return "";
  }
}

function setCookie(c_name,value,expiredays) {
  if (supports_html5_storage()) {
    try {
        localStorage.setItem(c_name, value);
        return;
    } catch (e) {
    }
  } else {
    var exdate=new Date();
    exdate.setDate(exdate.getDate()+expiredays);
    document.cookie=c_name+ "=" +escape(value)+
                     ((expiredays===null) ? "" : ";expires="+exdate.toUTCString());
  }
}

function setBoring(geno) {



  var understands = prompt('Going further will make a real change to SNPedia. It will set '+geno+' as magnitude=0 and repute=Good, which means boring. If you understand and want to make this change type: yes');

//      var understands = 'local';


  if (understands == 'yes') {

      realSetBoring(geno);
      alert('Done. If you add an exclation point, next time I wont ask again');

  } else if (understands == 'yes!') {

      setBoring = realSetBoring;
      setBoring(geno);


  } else if (understands == 'local') {

      setBoring = fakeSetBoring;
      setBoring(geno);

  } else {

      model.setGeno(geno, {
            'repute' : 'Good',
            'magnitude' : 0
            });
      updateTable();
      updateChart();
      alert('I only changed your local version');
  }
  return false;
}

function doGetGenoParts(geno) {

   var Geno = geno.charAt(0).toUpperCase() + geno.slice(1);
   $.ajax({
           url:      'http://www.snpedia.com/api.php?action=query&prop=revisions&titles='+Geno+'/criteria&rvprop=content&format=json',
           cache:    false,
           dataType: "jsonp",
           success:   function(data) {
              for (var i in data.query.pages) {
                var text = data.query.pages[i].revisions[0]["*"];
                var seen = {};
                var matchterms = text.match(/\b([rg]s\d+)\b/gi);
                if (matchterms) {
                    for (var idx in matchterms) {
                       chrom = matchterms[idx];
                       seen[chrom] = true;
                    }
                }
                matchterms = text.match(/\b(i\d+)\b/gi);
                if (matchterms) {
                    for (var idx in matchterms) {
                       chrom = matchterms[idx];
                       seen[chrom] = true;
                    }
                }

                var unique = new Array();
                for (var idx2 in seen) {
                    unique.push(idx2);
                }
                var textfilter = '('+geno+'|'+unique.join('|')+')';

                //console.log(textfilter);
                $('#textfilter').val(textfilter);
                updateGenos();

              }
            },
           error:   function(e, xhr) {
             console.log("failed");
             console.log(e);
             console.log(xhr);
           }
         });

}




if (typeof Array.prototype.push == 'undefined' ) {
    Array.prototype.push = function() {
     var i=0;
     var b=this.length;
     var a=arguments;
     for(i;i<a.length;i++) this[b+i]=a[i];
     return this.length;
   };
}


function showTags(p) {
     var o = new Array();
     if (p['tags']) {
         o.push('<div id="tags">');
         for(var u = 0; u < p['tags'].length; u++) {
             if (u > 0) {
                 o.push(' ');
             }
             o.push('<a class="label label-info taglink" href="#" >'+unescape(p['tags'][u])+'</a>');
         }
         o.push('</div>'); //tags
     }
     return o.join('');
}
function showClinVarDisease(p) {
  var o = new Array();
  if (p['clinvar_1']) {
      o.push('<span class="label label-inverse" href="#" >ClinVar');

      var msg = 'unset';
      if (       p['clinvar_1']=='5') {
        msg = '<span class="label label-important">Pathogenic</span>';
      } else if (p['clinvar_1']=='4') {
        msg = '<span class="label label-warning">Probable-pathogenic</span>';
      } else if (p['clinvar_1']=='3') {
        msg = '<span class="label label-success">Probable-non-pathogenic</span>';
      } else if (p['clinvar_1']=='2') {
        msg = '<span class="label label-success">Non-pathogenic</span>';
      } else if (p['clinvar_1']=='1') {
        msg = '<span class="label label-success">Untested</span>';
      } else if (p['clinvar_1']=='7') {
        msg = '<span class="label label-info">Histocompatibility</span>';
      } else if (p['clinvar_1']=='6') {
        msg = '<span class="label label-info">Drug-response</span>';
      } else if (p['clinvar_1']=='255') {
        msg = '<span class="label label-info">Other</span>';
      } else {
        msg = '<span class="label label-important">??</span>';
      }
      o.push(msg);

      if (p['clinvar_disease'] !== undefined) {
         var parts = p['clinvar_disease'].split(/;\s*/)
         for(var u = 0; u < parts.length; u++) {
           o.push('<a class="label label-inverse clinvar_link" href="#" >'+unescape(parts[u])+'</a> ');
         }
      }
      o.push('</span>');
  }
  return o.join('');
}

             if (numrefs < slidermin ) {

             }
             usebig = !magusecompact && !refsusecompact;

        }
        return usebig;

function freqsortfunc(a,b) {
   if (a.freq === undefined &&  b.freq === undefined) {
      return 0;
   } else if (a.freq === undefined) {
      return 1;
   } else if (b.freq === undefined) {
      return -1;
   } else if (a.freq == b.freq) {
      return 0;
   } else if (a.freq > b.freq) {
      return 1;
   } else {
      return -1;

   }
}

function gmafsortfunc(a,b) {
   if (a.gmaf === undefined &&  b.gmaf === undefined) {

      return -1;
   } else if (a.gmaf == b.gmaf) {
      return 0;
   } else if (a.gmaf > b.gmaf) {
      return 1;
   } else {
      return -1;

   }
}

 function chrom2int(chrom) {
    var chromint;
    if (chrom == 'X') {
       chromint = 23;
    } else if (chrom == 'Y') {
       chromint = 24;
    } else if (chrom == 'MT') {
       chromint = 25;
    } else if (chrom === undefined) {
       chromint = 26;
    } else {
       chromint = parseInt(chrom,10);
    }
    return chromint;
 }

 function pseudoposition(adict) {
    var scale = 1000000000;
    var out = chrom2int(adict['chrom']) * scale + adict['pos'];
    return out;
 }

 function locationsortfunc(a,b) {
    posa = pseudoposition(a);
    posb = pseudoposition(b);

    if (isNaN(posa) &&  isNaN(posb)) {
       return 0;
    } else if (isNaN(posa)) {
       return 1;
    } else if (isNaN(posb)) {
       return -1;
    } else if (posa > posb) {
       return 1;
    } else if (posa < posb) {
       return -1;
    } else {
       return 0;
    }

 }
 function datesortfunc(a,b) {
    if (a.rstime && a.genotime) {
      timea = Math.max(a.genotime, a.rstime);
    } else if (a.rstime) {
      timea = a.rstime;
    } else {
      timea = a.genotime;
    }

    if (b.rstime && b.genotime) {
      timeb = Math.max(b.genotime, b.rstime);
    } else if (b.rstime) {
      timeb = b.rstime;
    } else {
      timeb = a.genotime;
    }

    if (isNaN(timea) &&  isNaN(timeb)) {
       return 0;
    } else if (isNaN(timea)) {
       return -1;
    } else if (isNaN(timeb)) {
       return 1;
    } else if (timea > timeb) {
       return -1;
    } else if (timea < timeb) {
       return 1;
    } else {
       return 0;
    }

 }

function warmupData() {
    maxrefs = -Infinity;
    maxmag = -Infinity;
    minmag = Infinity;
    $.each(mygenos, function (i, p) {
        if (parseInt(p['numrefs'],10) > maxrefs) { maxrefs = parseInt(p['numrefs'],10); }


        var mag = 1;
        if (p['magnitude'] === undefined) {
            mag = 1;
        } else {
            mag = parseFloat(p['magnitude']);
        }




        if (mag > maxmag) { maxmag = mag; }
        if (mag < minmag) { minmag = mag; }

        // remember this for sorting
        p['original_index'] = i;

        // turn the array of tags into a hash for faster lookup
        p['tag'] = {};
        var thelen = 0;
        if ('tags' in p) thelen = p['tags'].length;
        for(var u = 0; u < thelen; u++) {
              tag = p['tags'][u];
              p['tag'][tag] = true;

        }

        // it would be better to pre-cook these in promethease, than to split on the semicolon
        if (p.clinvar_disease) {
            p['clinvar_tag'] = {};
            $.each(p.clinvar_disease.split('; '), function(i, label) {
                p['clinvar_tag'][label] = true;
            });
        }

        // compute it only once
        p['isASNP'] = isASNP(p);

        if (p.isASNP) {
            if (rsinfo[p.rsnum]) {
                var mags = $.map(rsinfo[p.rsnum], function (key) {return key.mag;});
                if (mags.length) {
                    p['maxmag'] = Math.max.apply(Math, mags);
                }
            }
        }
    });

}

function prepisWanted(viewtag) {



    var filterReputeGood = !$('input[name=filterGood]').is(':checked');
    var filterReputeBad = !$('input[name=filterBad]').is(':checked');
    var filterReputeNotSet = !$('input[name=filterNotSet]').is(':checked');
    var filterRepute = filterReputeGood || filterReputeBad || filterReputeNotSet;

    var filterSNPs = !$('input[name=filterSNPs]').is(':checked');
    var filterGenosets = !$('input[name=filterGenosets]').is(':checked');






    var filterSNPs = !$('input[name=filterSNPs]').is(':checked');
    var filterGenosets = !$('input[name=filterGenosets]').is(':checked');
    var filterclinvar = false;

    var textfilter = $( '#textfilter' ).val( );
    var filterclinvar_disease = $( '#' ).val( );
    //var filterclinvar = false;
    //var clinsigwanted = Object();


    //console.log(clinsigwanted);
    if ( clinsigwanted.length ) {
        console.log('allow filter clinvar');
        filterclinvar = true;

        if (clinsigwanted['999']) {
           filterclinvar = false;
           console.log('allowing all, and disabling filter clinvar');
        }
    }


    var doChrRegex = false;
    if (textfilter) {

       if ( textfilter.match(/\/CLNSIG=/) ) {
          var clinsigmatch = textfilter.match(/\/CLNSIG=(\S+)/);
          if (clinsigmatch) {
            filterclinvar = true;
            clinsigwanted = clinsigmatch[1].split(/,/)
          }
       }
       if ( textfilter.match(/\/COUNT.?=\d+/) ) {
          var match_count = textfilter.match(/\/COUNT(.?=)(\d+)/);
          if (match_count) {
            filter_count = true;
            filter_count_OP = match_count[1];
            filter_count_N = match_count[2];
          }
       }

       if ( textfilter.match(/^\/\w+/) ) {
          textfilter = textfilter.replace(/\s*\/\w+=?\S*/g,'');
       }

       if ( textfilter.match(/^chr/) ) {
           doChrRegex = true;
           var chrom = undefined;
           var startpos = undefined;
           var endpos = undefined;
           var matchchrom = textfilter.match(/^chro?m?\s*([0-9xymt]+)/i);
           if (matchchrom) {
             chrom = matchchrom[1].toUpperCase();
             var matchanchor = textfilter.match(/^chro?m?\s*[0-9xymt]+\s*:\s*(\d+)/);
             if (matchanchor) {

                  // found chr 3:5000-8000

                  startpos = parseInt(matchanchor[1], 10);
                  var matchrange = textfilter.match(/^chro?m?\s*[0-9xymt]+\s*:\s*\d+\s*[-:](\d+)/i);
                  if (matchrange && matchrange[1]) {
                     thepos = parseInt(matchrange[1], 10);
                     if (thepos > startpos) {
                         endpos = thepos;
                     }

                  } else {
                     // found chr 3:5000+3000
                     var matchplus = textfilter.match(/^chro?m?\s*[0-9xymt]+\s*:\s*\d+\s*\+(\d+)/i);
                     if (matchplus && matchplus[1]) {
                         thepos = parseInt(matchplus[1], 10);
                         endpos = startpos+thepos;
                     }
                  }
             }
           }
       }
    }



    var all_allowed = clinsigwanted['999']
    var myinMagRange = prepareinMagRange();
    var myinRanges = prepinRanges();

    var isWantedCheck = function (p) {

        if(viewtag && !p['tag'][viewtag]) return false;

        // piechart
        if (!(viewtag_clinvar_disease === undefined)) {
          if(viewtag_clinvar_disease) {
             var keyname='clinvar_disease';
             var keep = false;
             if (p[keyname]) {
                 var parts = p[keyname].split(/;\s*/);
                 for(var u = 0; u < parts.length; u++) {
                   var v = parts[u];
                   if (v == viewtag_clinvar_disease) {
                       keep = true;
                   }
                 }
             }
             if (!keep) { return false; }
          }
        }



        if (!all_allowed) {
              if (!clinsigwanted[p['clinvar_1']]) {
                 return false;
              }
        }

        if (filterRepute) {
           var repute = p['repute'];
           if (repute == 'Good' && filterReputeGood) return false;
           if (repute == 'Bad' && filterReputeBad) return false;
           if (repute === undefined && filterReputeNotSet) return false;
        }

        if (filter_count_N) {
           if (p.count < filter_count_N) return false;
        }

        if (filterclinvar) {
            console.log('filterclinvar');
            var clinsig = p['clinvar_1'];
            console.log(clinsig);
            var match = false;
            if (!(clinsig === undefined)) {
                 if (clinsigwanted[String(clinsig)]) {
                         match = true;
                 }
            }
            if (!match) return false;
        }


        if (textfilter) {
           var match;
           if ( doChrRegex ) {
               match = true;
               if (match && p.chrom != chrom) match = false;
               if (match && p.pos < startpos) match = false;
               if (match && p.pos > endpos && endpos > startpos) match = false;
               if (!match) return false;
           } else {
               match = false;
               var patt=new RegExp(textfilter,'i');
               if (p.rstext && patt.test(p.rstext)) match = true;
               if (!match && p.title && patt.test(p.title)) match = true;

               if (!match && p.clinvar_disease) {
                 var clinvar_diseases = p.clinvar_disease.split(/;\s*/)
                 for(var u = 0; !match && u < clinvar_diseases.length; u++) {
                    if (patt.test(clinvar_diseases[u])) match = true;
                 }
               }

               if (!match && p.genobody && patt.test(p.genobody)) match = true;
               if (!match && p.genosummary && patt.test(p.genosummary)) match = true;
               if (!match && p.gene && patt.test(p.gene)) match = true;
               if (!match && p.dbsnp && patt.test(p.dbsnp)) match = true;
               if (!match && p.tags) {
                   var tagidx;
                   for (tagidx in p['tags']) {
                      if (!match && patt.test(p['tags'][tagidx])) match = true;
                   }
               }
               if (!match) return false;
           }
        }

        if (p['isASNP']) {
          if (filterSNPs) return false;
          if (myinRanges(p)) return true;
        } else {
              if (filterGenosets) return false;
              if (myinMagRange(p)) {return true;}
        }
        return false;
    };
    return isWantedCheck;
}

function genosHTML() {

  var blocks = new Array();
  var maxitems = parseInt($( '#maxitems' ).val( ),10);
  if (!maxitems) {
     $( '#maxitems' ).val( 10 );
     maxitems = 10;
  }

  var count = 0;
  var skipped = 0;
  var missed = 0;
  var masked = 0;

  var myisWanted = prepisWanted(viewtag);
  var myinRanges = prepinRanges();

  model.each(function (i, p) {
      var skip = 0;
      if (count >= maxitems) {
         skipped++;
         skip++;
      }
      if(viewtag && !p['tag'][viewtag]) return;
  
      var wanted = myisWanted(p);
      if (!wanted) return;
  
      if (clinsigwanted) {
       if (!clinsigwanted['999']) {
          if (!clinsigwanted[p['clinvar_1']]) {
              return;
          }
       }
      } else {
              console.log('  early undef');
      } 
  
  
      if (p['isASNP']) {
          if (!skip) {
             if (myinRanges(p)) {
                 blocks.push(generateRsFormat(p));
                 count++;
             }  else {
                 masked++;
             }
          } else {
             missed++;
          }
      } else if(!(p['title']===undefined)) {
  
          if (!skip) {
             if (myinRanges(p)) {
                 blocks.push(generateGenosetFormat(p));
                 count++;
             } else {
                 masked++;
             }
          } else {
             missed++;
          }
        }
  });


  if (missed) {
      blocks.push('<div id="footerBox">');
      blocks.push('<div id="footer"  class="boxresult">');
      blocks.push('<button class="tooltipped" title="Fast way to allow twice as many visible rows" id="more" onclick="wantmore();">2x more</button>');
      blocks.push('</div>');
      blocks.push('</div>');
  }
  
  $( "#num_missed" ).val( missed );
  $( "#num_count" ).val( count );
  
  return blocks.join('');
}

function setSort(name) {
var reverse = false;
var sortf = magsortfunc;
var suffix = '-rev';
if        (name.indexOf('magnitude') === 0)  { sortf = magsortfunc;
} else if (name.indexOf('maxmagnitude') === 0)  { sortf = maxmagsortfunc;
} else if (name.indexOf('frequency') === 0)  { sortf = freqsortfunc;
} else if (name.indexOf('gmaf') === 0)  { sortf = gmafsortfunc;
} else if (name.indexOf('references') === 0) { sortf = refsortfunc;
} else if (name.indexOf('location') === 0)   { sortf = locationsortfunc;
} else if (name.indexOf('mod-date') === 0)   { sortf = datesortfunc;
}

if (name.indexOf(suffix, name.length - suffix.length) !== -1) reverse = true;

model.setFlag('reverse', reverse);
model.setSort(sortf);

updateTable();
return false;
}

function uintToString(uintArray) {

    var encodedString = String.fromCharCode.apply(null, uintArray),
        decodedString = decodeURIComponent(escape(encodedString));
    return decodedString;
}

function decompressString(s) {
   var compressData = atob(s);
   var compressData2 = compressData.split('').map(function(e) {return e.charCodeAt(0)});
   var inflate = new Zlib.Inflate(compressData2);
   var output = JSON.parse(uintToString(inflate.decompress()));
   return output;
}

 "freqcolor": "#FFB1B1", "numrefs": 11, "title": "rs910873(A;G)", "genosummary": "1.7x increased risk of melanoma; increased risk of squamous cell carcinoma", "genobody": "You carry one allele associated with an increased risk for melanoma and squamous cell carcinoma. Watch for unusual or expanding skin growths or moles, always use SPF 30, and avoid the direct sun between 10am and 4pm. In a nested case-control study based on the Nurses Health Study, the correlation between rs910873 and skin cancer was examined in a Caucasian population. This study included 218 melanoma cases, 285 squamous cell carcinoma (SCC) cases, 300 basal cell carcinoma (BCS) cases, and 870 age-matched controls. rs910873 was found to be significantly associated with increased risks of melanoma and SCC (but not BSC) in both additive (additive OR for melanoma, 1.67; 95% CI, 1.19&#8211;2.34; additive OR for SCC, 1.51; 95% CI, 1.09-2.10) and dominant models (G;A or A;A; dominant OR for melan...", "repute": "Bad", "tags": ["Coriell Personalized Medicine Collaborative", "Melanoma"], "effect": "1.7x increased risk of melanoma; increased risk of squamous cell carcinoma  You carry one allele associated with an increased risk for melanoma and squamous cell carcinoma. Watch for unusual or expanding skin growths or moles, always use SPF 30, and avoid the direct sun between 10am and 4pm. In a nested case-control study based on the Nurses Health Study, the correlation between rs910873 and skin cancer was examined in a Caucasian population. This study included 218 melanoma cases, 285 squamous cell carcinoma (SCC) cases, 300 basal cell carcinoma (BCS) cases, and 870 age-matched controls. rs910873 was found to be significantly associated with increased risks of melanoma and SCC (but not BSC) in both additive (additive OR for melanoma, 1.67; 95% CI, 1.19&#8211;2.34; additive OR for SCC, 1.5...", "magcolor": "#FF9090", "gmaf": 0.021579999999999998, "freq": 15.0, "chrom": "20", "rstext": "A total of 2,019 cutaneous melanoma cases and 2,105 controls (Australians of European descent) were included in this genome-wide pooling association study. Using pooling, a new melanoma risk locus was identified on chromosome 20 (rs910873 and rs1885120; combined P &lt; 1E-15. The per allele odds ratio was 1.75 (95% CI, 1.53-2.01), with evidence for stronger association in early-onset cases (age \u226440 OR, 1.83 (95% CI, 1.39-2.41); age &gt;40 OR, 1.30 (95% CI, 1.00-1.69)). This study, which was conducted within the Nurses' Health Study, included 492 cases of non-melanoma skin cancer (NMSC; basal cell and squamous cell carcinomas) and 619 controls. The subjects were all Caucasian women, and the follow-up period was 28 years. rs910873, an ASIP gene-related SNP, was found to be associated with an...", "url": "http://www.snpedia.com/index.php/rs910873(A;G)", "rstime": 20140530011337, "geno": "(A;G)", "magnitude": 3.0, "gene": "PIGU"}, {"orientation": "plus", "color": "#FF9090", "rsnum": "rs11614913", "pos": "53991815", "frequency": "33.6%", "freqcolor": "#FFCECE", "numrefs": 50, "title": "rs11614913(C;C)", "genosummary": "increased risk of various types of cancer", "genobody": "This variant increases risk of numerous types of cancer in many studies. It is in a microRNA", "repute": "Bad", "tags": ["Lung cancer", "MicroRNA"], "effect": "increased risk of various types of cancer  This variant increases risk of numerous types of cancer in many studies. It is in a microRNA", "magcolor": "#FF9090", "gmaf": 0.38800000000000001, "freq": 33.600000000000001, "chrom": "12", "rstext": "miRNA sequences and non-small cell lung cancer rs11614913 SNP in hsa-mir-196a2 was associated with survival in individuals with NSCLC. Specifically, survival was significantly decreased in individuals who were homozygous CC at SNP rs11614913. microRNA 1,009 breast cancer cases and 1,093 controls in a population of Chinese women *rs11614913 in hsa-mir-196a2 T&gt;C 1.23; 95% confidence interval [CI], 1.02-1.48 *rs3746444 in hsa-mir-499 A&gt;G OR 1.25; 95% CI, 1.02-1.51 Single nucleotide polymorphisms of microRNA machinery genes modify the risk of renal cell carcinoma. Genetic variations in microRNA-related genes are novel susceptibility loci for esophageal cancer risk. Signatures of purifying and local positive selection in human miRNAs. MicroRNA polymorphisms: the future of pharmacogenomics...", "url": "http://www.snpedia.com/index.php/rs11614913(C;C)", "rstime": 20140614000613, "geno": "(C;C)", "magnitude": 3.0, "gene": "MIR196A2"}, {"orientation": "plus", "color": "#FF9090", "rsnum": "rs2180439", "pos": "21872462", "frequency": "38.1%", "freqcolor": "#FFD3D3", "numrefs": 5, "title": "rs2180439(T;T)", "genosummary": "2x increased risk of Male Pattern Baldness.", "genobody": "Verified in Europeans and Asians. Family Tree DNA reports this SNP as more likely to go bald, but 23andMe doesn't mention it.", "repute": "Bad", "tags": ["Baldness", "Family Tree DNA Factoids"], "effect": "2x increased risk of Male Pattern Baldness.  Verified in Europeans and Asians. Family Tree DNA reports this SNP as more likely to go bald, but 23andMe doesn't mention it.", "magcolor": "#FF9090", "gmaf": 0.44209999999999999, "freq": 38.100000000000001, "chrom": "20", "rstext": "spitoon rs2180439(T;T) have 2x increased odds of male pattern baldness.  [PharmGKB:Non-Curated Susceptibility variants for male-pattern baldness on chromosome 20p11. (Initial Sample Size: 296 cases, 347 controls; Replication Sample Size: 319 cases, 234 controls); (Region: 20p11.22; Reported Gene: PAX1, BQ013595, BE789145; Risk Allele: rs2180439-C) This variant is associated with Male-pattern baldness.] [OMIM:ALOPECIA, ANDROGENETIC, 3; AGA3] [GWAS:Male-pattern baldness]", "url": "http://www.snpedia.com/index.php/rs2180439(T;T)", "rstime": 20140530124539, "geno": "(T;T)", "magnitude": 3.0}, {"orientation": "minus", "color": "#FF9090", "rsnum": "rs3738579", "pos": "182586901", "frequency": "38.1%", "freqcolor": "#FFD3D3", "numrefs": 0, "title": "rs3738579(T;T)", "genosummary": "1.5x - 2x increased risk for cervical cancer, HNSCC, and breast cancer", "repute": "Bad", "tags": ["Breast cancer", "Cancer"], "effect": "1.5x - 2x increased risk for cervical cancer, HNSCC, and breast cancer", "magcolor": "#FF9090", "gmaf": 0.2392, "freq": 38.100000000000001, "chrom": "1", "rstext": "rs3738579 represents a SNP in the 5' UTR region upstream of the RNASEL gene. A study of patients diagnosed with carcinoma of the uterine cervix, head and neck squamous cell carcinomas (HNSCC), and breast cancer found 1.5x-2x increased risk for all three cancer types for the rs3738579(T;T) genotype, while finding decreased risk (0.5x) for rs3738579(C;T) heterozygotes. rs3738579(C;C) homozygotes had 0.6x less risk for cervical cancer but increased risk for HNSCC (1.4x) and breast cancer (1.8x). Although statistics were not reported per genotype, a combination of data from all three cancer forms over all genotypes provided strong statistical evidence for rs3738579 as a cancer marker, with a p-value of 4.43\u00c3\u201410e\u00e2\u02c6\u20195.", "url": "http://www.snpedia.com/index.php/rs3738579(T;T)", "rstime": 20140530211119, "geno": "(T;T)", "magnitude": 3.0, "gene": "RNASEL"}, {"orientation": "minus", "color": "#FF9090", "rsnum": "rs2981582", "pos": "123352317", "frequency": "41.6%", "freqcolor": "#FFD7D7", "numrefs": 33, "title": "rs2981582(C;T)", "genosummary": "1.3x higher risk of ER+ breast cancer", "repute": "Bad", "tags": ["Breast cancer", "Coriell Personalized Medicine Collaborative"], "effect": "1.3x higher risk of ER+ breast cancer", "magcolor": "#FF9090", "gmaf": 0.40500000000000003, "freq": 41.600000000000001, "chrom": "10", "rstext": "rs2981582 in the FGFR2 gene was one of the four strongest associations found in a genome-wide association study (GWAS) of over 4,000 breast cancer samples. The T allele was more strongly related to ER-positive (per-allele odds ratio 1.31 (CI: 1.27-1.36)) than ER-negative (odds ratio 1.08 (CI:1.03-1.14)) disease (p for heterogeneity = 10(-13)). While on its own still of fairly small effect, this was the most significant of 7 SNPs to help estimate risk of breast cancer. Family history and/or BRCA1 or BRCA2 testing status are more significant factors, which were not part of this panel. Based on a study of 1,049 Chinese breast cancer patients, carriers of risk alleles at three SNPs (rs2981582, rs1219648 and rs2420946) were at 1.36x increased risk for breast cancer (CI: 1.13-1.62, p = 0.001). A...", "url": "http://www.snpedia.com/index.php/rs2981582(C;T)", "rstime": 20140525065259, "geno": "(C;T)", "magnitude": 3.0, "gene": "FGFR2"}, {"orientation": "plus", "clinvar_1": "255", "color": "#FF9090", "rsnum": "rs13266634", "pos": "117172544", "frequency": "56.6%", "freqcolor": "#FFE4E4", "clinvar_disease": "Diabetes mellitus type 2", "numrefs": 115, "title": "rs13266634(C;C)", "genosummary": "increased risk for type-2 diabetes", "repute": "Bad", "tags": ["ClinVar", "Gestational diabetes", "Type-1 diabetes", "Type-2 diabetes"], "effect": "increased risk for type-2 diabetes", "gmaf": 0.28239999999999998, "freq": 56.600000000000001, "chrom": "8", "rstext": "rs13266634 is a SNP in the zinc transporter protein member 8 SLC30A8 gene that has primarily been associated with type-2 diabetes in several studies. This SNP is also known as the Arg325Trp or R325W variant; the (C) allele encodes the arginine (R), and the (T) allele encodes the tryptophan (W). significantly associated p = 0.0073; in 1,630 Japanese subjects with type-2 diabetes and in 1,064 controls The major alleles of the SLC30A8 SNP rs13266634 and the HHEX SNP rs7923837 associate with reduced insulin secretion, but not with insulin resistance. 46% of European non-diabetic offspring of type-2 diabetes patients are rs13266634(C;C) homozygotes; they are diabetes-prone and characterised by a 19% decrease in first-phase insulin release following an intravenous glucose load. * Note: this SNP,...", "url": "http://www.snpedia.com/index.php/rs13266634(C;C)", "rstime": 20140531213856, "magcolor": "#FF9090", "geno": "(C;C)", "magnitude": 3.0, "gene": "SLC30A8"}]);

function Model (type) {
this._all = undefined;
this.other = {'start':'here'};


this.dump = function() {
   $.each(this._all, function(k,v) {
      console.log(v.title + v.repute+v.magnitude);
   });

};


this.loadRaw = function(allgenos) {
     this._all = allgenos;
};

this.setGeno = function(title, thedict) {
    var thethe = $.grep(this._all, function(p, i) {
         return ( p && p.title == title );
         });
     $.each(thedict, function (k,v) {
        thethe.forEach(function (x) {x[k] = v;});
     });
    };


this.setSort = function(thefunc) {
    //console.log('setting sort');
    this.other.sort = thefunc;
};
this.getSort = function() {
    //console.log('getting sort');
    return this.other.sort;
};
this.setFlag = function(key, value) {
    //console.log('really setting '+key+' = '+value);
    this.other[key] = value;
};
this.getFlag = function(key) {
//        console.log('getting '+key+' = ?');
    return this.other[key];
};



this.each = function (f) {
   doRev = model.getFlag('reverse');

   showGood = $('#filterGood');
   showBad = $('#filterBad');
   showNotSet = $('#filterNotSet');

   g = function(i, p) {
      if ((showGood   || !showGood   && p.repute == 'Good') &&
          (showBad    || !showBad    && p.repute == 'Bad') &&
          (showNotSet || !showNotSet && !p.repute))
         return f(i,p);
   };



   if (doRev) {
     return $.each(model._all.sort(model.getSort()).reverse(), f);
   } else {
     return $.each(model._all.sort(model.getSort()), f);
   }
};

}

function View (type) {
this.type = type;
this.color = "red";
this.getInfo = function() {
    return this.color + ' ' + this.type + ' apple';
};
}

function Controller (type) {
this.type = type;
this.color = "red";
this.getInfo = function() {
    return this.color + ' ' + this.type + ' apple';
};
}


var model = new Model();
model.loadRaw(mygenos);
